import React from 'react';
import { Link } from 'react-router-dom';
import { FaCog, FaComments, FaSignOutAlt } from 'react-icons/fa';
import './src/styles/user-nav.css'; // Ensure you have CSS for styling

function Sidebar() {
  return (
    <div className="sidebar">
      <ul>
        <li>
          <Link to="/settings">
            <FaCog /> Settings
          </Link>
        </li>
        <li>
          <Link to="/feedback">
            <FaComments /> Feedback
          </Link>
        </li>
        <li>
          <Link to="/logout">
            <FaSignOutAlt /> Logout
          </Link>
        </li>
      </ul>
    </div>
  );
}

export default Sidebar;
